output = ""
key = []
def get_last_number(output):
    last_number = ""
    y = 0
    for i in xrange(len(output)-1, -1 , -1):
        y = i
        # try to figure out the end out an number
        if output[i-5:i] == "00000":
            break
        last_number = output[i] + last_number
        if(len(output) > 37):
            last_number = output[y] + last_number
    return long(last_number)